import React, { useState } from 'react'
import EntityDisplay from './EntityDisplay'
import System, { system } from '../classes/System'

const SystemDisplay = props => {

    const [system, setSystem] = useState(new System())

    const entities = system.planets.map((planet, index) =>(
        <EntityDisplay key={index} entity={planet} />
    ))

    return (
        <div className="space">
            {entities}
        </div>
    )
}

export default SystemDisplay
